Social Media is a great place for prospecting, listening, having meaningful conversations and building relationships, but if you're not showing up in the right way, you'll be wasting your precious time. ⠀⠀⠀⠀⠀⠀⠀⠀⠀
⠀⠀⠀⠀⠀⠀⠀⠀⠀
+ Rule 1: Don't misunderstand the platform. Social Media is fundamentally a communication channel, NOT a marketing channel. It's a two way channel for intentional dialog, showcasing your best possible profile.⠀⠀⠀⠀⠀⠀⠀⠀⠀
⠀⠀⠀⠀⠀⠀⠀⠀⠀
+ Rule 2: Don't try to sell your products or services immediately. Create and build relationships for your audience to KNOW, LIKE & TRUST⠀⠀⠀⠀⠀⠀⠀⠀⠀
⠀⠀⠀⠀⠀⠀⠀⠀⠀
+ Rule 3: Don't ignore your audience. Are you taking on feedback and adapting your content based on consumers needs? Social Listening is such an important tool to get to know your audiences way of thinking and acting, as well as understanding real conversations.⠀⠀⠀⠀⠀⠀⠀⠀⠀
⠀⠀⠀⠀⠀⠀⠀⠀⠀
+ Rule 4: Are you scheduling your content and sitting back waiting for the all the likes, comments and shares to come flooding in? You'll be waiting a fair while. Social media engagement is not a passive experience; it’s a way to proactively interact with someone who might be interested in your product or brand now or in the future. When you post, it's IMPERATIVE that you hop on and engage with your audience and other likable accounts.⠀⠀⠀⠀⠀⠀⠀⠀⠀
⠀⠀⠀⠀⠀⠀⠀⠀⠀
+ Rule 5:  Don't be inconsistent with your branding. Consistency across your brand gives people confidence that they are seeing brand value, again to KNOW, LIKE & TRUST. The value of consistency is nothing new — it’s a key to recognition and success.⠀⠀⠀⠀⠀⠀⠀⠀⠀
